import React from 'react';
import { useEffect } from 'react';
import { useState } from 'react';
import { Button, Col, Container, Form, Row } from 'react-bootstrap';

import logo from '../../images/logos/logo.png'
import { Link, makeStyles } from '@material-ui/core';
import img from '../../images/logos/plus 1.png'
import CloudUploadIcon from '@material-ui/icons/CloudUpload';


const useStyles = makeStyles((theme) => ({
    button: {
      margin: theme.spacing(1),
    },
  }));

const AddEvent = () => {
    const [register, setRegister] = useState([])

    useEffect(() => {
        fetch('http://localhost:4000/volunteer')
            .then(res => res.json())
            .then(data => setRegister(data))

    }, [])

    const classes = useStyles();


    return (
        <div style={{ margin: '20px', padding: '20px' }}>
            <Row>
                <Col xs={12} md={3}>
                    <nav className="nav  justify-content-between">
                        <ul>
                            <img style={{ height: '50px' }} className="logo" src={logo} alt="" />
                        </ul>
                    </nav>
                    <nav className="nav  justify-content-between">
                        <ul>
                            <li>
                                <Link to="/admin">
                                    <button to="/admin"> <img style={{ width: '20px' }} src={img} alt="" /> Add Event </button>
                                </Link>
                            </li>
                        </ul>

                    </nav>
                </Col>

                <Col xs={12} md={9}>
                    <h1>Add Event</h1>
                    <br />

                    <Form>
                        <Form.Row>
                            <Col>
                                <Form.Label>Enter Title</Form.Label>
                                <Form.Control type='text' />
                            </Col>

                            <Col>
                                <Form.Label>Enter Event</Form.Label>
                                <Form.Control type='text' />
                            </Col>

                        </Form.Row>
                        <Form.Row>
                            <Col>
                                <Form.Label>Description</Form.Label>
                                <Form.Control type='text' />
                            </Col>
                            <Col>
                                <Form.Group>
                                    <Button
                                        variant="contained"
                                        color="default"
                                        className={classes.button}
                                        startIcon={<CloudUploadIcon />}
                                    >
                                        Upload
      </Button>
                                </Form.Group>
                            </Col>


                        </Form.Row>
                    </Form>


                </Col>
            </Row>
        </div>
    );
};

export default AddEvent;
